import React from 'react';
import { useNavigate } from 'react-router-dom';
import '../styles/HomePage.css';

const HomePage = () => {
  const navigate = useNavigate();

  return (
    <div className="home-container">
      <h1>Lab Management System</h1>
      <div className="cards-container">
        <div 
          className="status-card working"
          onClick={() => navigate('/working')}
        >
          <h2>Working Computers</h2>
          <div className="status-count">Loading...</div>
        </div>

        <div 
          className="status-card not-working"
          onClick={() => navigate('/non-working')}
        >
          <h2>Non-Working Computers</h2>
          <div className="status-count">Loading...</div>
        </div>
      </div>
    </div>
  );
};

export default HomePage;
